(15,	23,	0,	'',	'{\"name\":\"Untitled Form 1\",\"logo\":null,\"tree\":[[[{\"title\":\"Paragraph\",\"label\":\"Comments\",\"type\":\"wysiwyg\",\"htmlName\":\"cmt1052343572\",\"noProperty\":true,\"editMode\":false,\"isInstruction\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 5\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: ArialMT; color: #365f91; text-decoration: underline;\\\">THIS REPORT IS NOT TRANSFERABLE FROM THE CLIENT NAMES ABOVE </span></span></p>\\n<p style=\\\"text-align: center;\\\">&nbsp;</p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: Arial; font-weight: bold;\\\">SCOPE OF INSPECTION </span></span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">These standards of practice define the minimum levels of inspection required for substantially completed residential improvements to real property up to four dwelling units. A real estate inspection is a non-technically exhaustive, limited visual survey and basic performance evaluation of the systems and components of a building using normal controls and does not require the use of specialized equipment or procedures. The purpose of the inspection is to provide the client with information regarding the general condition of the residence at the time of inspection. The inspector may provide a higher level of inspection performance than required by these standards of practice and may inspect components and systems in addition to those described by the standards of practice </span></p>\\n<p>&nbsp;</p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: Arial; font-weight: bold;\\\">GENERAL LIMITATIONS </span></span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">The inspector is not required to: (A) inspect: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) items other than those listed within these standards of practice; (ii) elevators; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(iii) detached buildings, decks, docks, fences, or waterfront structures or equipment; (iv) anything buried, hidden, latent, or concealed;<br /> (v) sub-surface drainage systems; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(vi) automated or programmable control systems, automatic shut-off, photoelectric sensors, timers, cocks, metering devices, signal lights, lightning arrestor system, remote controls, security or data distribution systems, solar panels, refrigerators (built-in or free standing), wine coolers, ice makers or smart home automation components; or<br /> (vii) concrete flatwork such as; driveways, sidewalks, walkways, paving stones or patios </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(B) report: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) past repairs that appear to be effective and workmanlike except as specifically required by these standards; (ii) cosmetic or aesthetic conditions; or<br /> (iii) wear and tear from ordinary use; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(C) determine: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) insurability, warrantability, suitability, adequacy, compatibility, capacity, reliability, marketability, operating costs, recalls, counterfeit products, product lawsuits, life expectancy, age, energy efficiency, vapor barriers, thermostatic performance, compliance with any code, listing, testing or protocol authority, utility sources, or manufacturer or regulatory requirements except as specifically required by these standards; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(ii) the presence or absence of pests, termites, or other wood-destroying insects or organisms;<br /> (iii)the presence, absence, or risk of asbestos, lead-based paint, </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">MOLD</span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">, mildew, corrosive or contaminated drywall &ldquo;Chinese Drywall&rdquo; or any other environmental hazard, environmental pathogen, carcinogen, toxin, mycotoxin, pollutant, fungal presence or activity, or poison;<br /> (iv) types of wood or preservative treatment and fastener compatibility; or </span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(v) the cause of source of a conditions; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(D) anticipate future events or conditions, including but not limited to: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) decay, deterioration, or damage that may occur after the inspection; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(ii) deficiencies from abuse, misuse or lack of use;<br /> (iii) changes in performance of any component or system due to changes in use or occupancy; (iv) the consequences of the inspection or its effects on current or future buyers and sellers; (v) common household accidents, personal injury, or death;<br /> (vi) the presence of water penetrations; or<br /> (vii) future performance of any item;</span></p>\\n<div class=\\\"page\\\" title=\\\"Page 6\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(E) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">operate shut-off, safety, stop, pressure or pressure-regulating valves or items requiring the use of codes, keys, combinations, or similar devices;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(F) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">designate conditions as safe;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(G) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">recommend or provide engineering, architectural, appraisal, mitigation, physical surveying, realty, or other specialist services; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(H) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">review historical records, installation instructions, repair plans, cost estimates, disclosure documents, or other reports; </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(I) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">verify sizing, efficiency, or adequacy of the ground surface drainage system;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(J) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">verify sizing, efficiency, or adequacy of the gutter and downspout system;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(K) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">operate recirculation or sump pumps </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(L) </spa