(16,	23,	0,	'',	'{\"name\":\"Untitled Form 1\",\"logo\":null,\"tree\":[[[{\"title\":\"Paragraph\",\"label\":\"Comments\",\"type\":\"wysiwyg\",\"htmlName\":\"cmt730608668\",\"noProperty\":true,\"editMode\":false,\"isInstruction\":false,\"data\":\"<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; text-align: center;\\\"><span style=\\\"box-sizing: border-box; text-decoration-line: underline; font-size: 12pt;\\\"><span style=\\\"box-sizing: border-box; font-family: ArialMT; color: #365f91;\\\">THIS REPORT IS NOT TRANSFERABLE FROM THE CLIENT NAMES ABOVE</span></span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; text-align: center;\\\">&nbsp;</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; text-align: center;\\\"><span style=\\\"box-sizing: border-box; text-decoration-line: underline; font-size: 12pt;\\\"><span style=\\\"box-sizing: border-box; font-family: Arial; font-weight: bold;\\\">SCOPE OF INSPECTION</span></span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">These standards of practice define the minimum levels of inspection required for substantially completed residential improvements to real property up to four dwelling units. A real estate inspection is a non-technically exhaustive, limited visual survey and basic performance evaluation of the systems and components of a building using normal controls and does not require the use of specialized equipment or procedures. The purpose of the inspection is to provide the client with information regarding the general condition of the residence at the time of inspection. The inspector may provide a higher level of inspection performance than required by these standards of practice and may inspect components and systems in addition to those described by the standards of practice</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\">&nbsp;</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; text-align: center;\\\"><span style=\\\"box-sizing: border-box; text-decoration-line: underline; font-size: 12pt;\\\"><span style=\\\"box-sizing: border-box; font-family: Arial; font-weight: bold;\\\">GENERAL LIMITATIONS</span></span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold;\\\">The inspector is not required to: (A) inspect:</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(i) items other than those listed within these standards of practice; (ii) elevators;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(iii) detached buildings, decks, docks, fences, or waterfront structures or equipment; (iv) anything buried, hidden, latent, or concealed;<br style=\\\"box-sizing: border-box;\\\" />(v) sub-surface drainage systems;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(vi) automated or programmable control systems, automatic shut-off, photoelectric sensors, timers, cocks, metering devices, signal lights, lightning arrestor system, remote controls, security or data distribution systems, solar panels, refrigerators (built-in or free standing), wine coolers, ice makers or smart home automation components; or<br style=\\\"box-sizing: border-box;\\\" />(vii) concrete flatwork such as; driveways, sidewalks, walkways, paving stones or patios</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold;\\\">(B) report:</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(i) past repairs that appear to be effective and workmanlike except as specifically required by these standards; (ii) cosmetic or aesthetic conditions; or<br style=\\\"box-sizing: border-box;\\\" />(iii) wear and tear from ordinary use;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold;\\\">(C) determine:</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(i) insurability, warrantability, suitability, adequacy, compatibility, capacity, reliability, marketability, operating costs, recalls, counterfeit products, product lawsuits, life expectancy, age, energy efficiency, vapor barriers, thermostatic performance, compliance with any code, listing, testing or protocol authority, utility sources, or manufacturer or regulatory requirements except as specifically required by these standards;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(ii) the presence or absence of pests, termites, or other wood-destroying insects or organisms;<br style=\\\"box-sizing: border-box;\\\" />(iii)the presence, absence, or risk of asbestos, lead-based paint,&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold;\\\">MOLD</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">, mildew, corrosive or contaminated drywall &ldquo;Chinese Drywall&rdquo; or any other environmental hazard, environmental pathogen, carcinogen, toxin, mycotoxin, pollutant, fungal presence or activity, or poison;<br style=\\\"box-sizing: border-box;\\\" />(iv) types of wood or preservative treatment and fastener compatibility; or</span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(v) the cause of source of a conditions;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold;\\\">(D) anticipate future events or conditions, including but not limited to:</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">(i) decay, deterioration, or damage that may occur after the inspection;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-f