span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">had limited visibility&nbsp;</span><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">had full visibility&nbsp;</span><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">Not accessible</span></p>\",\"hash\":1519317381413,\"$$hashKey\":\"object:43\"},{\"title\":\"Comment\",\"label\":\"Crawl space does not appear to be adequately ventilated\",\"type\":\"comment\",\"htmlName\":\"cmt941200159\",\"editMode\":false,\"data\":\"<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">Covers should be removed for proper ventilation</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">1 sq.ft. of ventilation is required for every 150 sq.ft. of crawl space<br style=\\\"box-sizing: border-box;\\\" /></span><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">Vent openings should be located within 3&rsquo; of each corner</span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-