T;\\\">) Therefore, the opinions expressed are one of apparent conditions and not of absolute fact and are only good for the date and time of this inspection.</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">The inspection of the foundation may show it to be providing adequate support for the structure or having movement typical to this region at the time of the inspection. This does not guarantee the future life or failure of the foundation.&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold; font-style: italic;\\\">The Inspector is not a structural engineer. This inspection is not an engineering report or evaluation and should not be considered one, either expressed or implied.&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">If any cause of concern is noted on this report, or if you want further evaluation, you should consider an evaluation by an engineer of your choice.&nbsp;</span></p>\",\"hash\":1519317481613,\"$$hashKey\":\"object:47\"}]],[[{\"title\":\"Sub Section\",\"label\":\"B. Grading and Drainage\",\"type\":\"subsection\",\"data\":\"\",\"single\":true,\"hash\":1519317923884,\"status4\":true}]],[[{\"title\":\"Comment\",\"label\":\"Improper or inadequate grading around the foundation\",\"type\":\"comment\",\"htmlName\":\"cmt414422118\",\"editMode\":false,\"data\":\"<p><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">Soil level should be at least 4&rdquo; below brick/stone siding<br style=\\\"box-sizing: border-box;\\\" /></span><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">Soil level should be at least 6&rdquo; below wood/other cladding</span></p>\",\"hash\":1519317932068,\"$$ha