color: #333333; font-family: sans-serif;\\\">Trim limbs, foliage away from roof to prevent shingle damage</p>\\n<p class=\\\"MsoNormal\\\" style=\\\"box-sizing: border-box; margin: 0in 0in 1.65pt 119.85pt; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; text-indent: 0in; line-height: 14.98px;\\\"><span style=\\\"box-sizing: border-box;\\\">&nbsp;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">Evidence of water penetration observed at:</p>\\n<p class=\\\"MsoNormal\\\" style=\\\"box-sizing: border-box; margin: 0in 0in 1.65pt 119.85pt; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; text-indent: 0in; line-height: 14.98px;\\\"><span style=\\\"box-sizing: border-box;\\\">&nbsp;</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">Evidence of previous repairs to the roof covering material, to flashing details, skylights, and other roof penetrations</p>\",\"hash\":1519318434906,\"$$hashKey\":\"object:99\"},{\"title\":\"Comment\",\"label\":\"A satellite dish was installed on the roof. Even though the holes are sealed, this can be an area of ongoing maintenance and prone to leaks since the bolts penetrate through the roof shingles and decking.\",\"type\":\"comment\",\"htmlName\":\"cmt834895650\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">A satellite dish was installed on the roof. Even though the holes are sealed, this can be an area of ongoing maintenance and prone to leaks since the bolts penetrate through the roof shingles and decking.</span><span style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\">&nbsp;</span></p>\",\"hash\":1519318465808,\"$$hashKey\":\"object:100\"},{\"title\":\"Comment\",\"label\":\"Deficiencies in:\",\"type\":\"comment\",\"htmlName\":\"cmt468413280\",\"editMode\":false,\"data\":\"<p class=\\\"MsoNormal\\\" style=\\\"box-sizing: border-box; margin: 0in 0in 0.05in; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400; text-indent: 0in;\\\">Fasteners</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\">Adhesion</p>\",\"hash\":1519318487383,\"$$hashKey\":\"object:101\"},{\"title\":\"Comment\",\"label\":\"Roof covering materials\",\"type\":\"comment\",\"htmlName\":\"cmt1150363195\",\"editMode\":false,\"data\":\"<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\">Torn or missing shingles observed<br style=\\\"box-sizing: border-box;\\\" />Damaged shingles observed</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\"><br style=\\\"box-sizing: border-box;\\\" />Cracked shingles observed<br style=\\\"box-sizing: border-box;\\\" />Several areas of granular loss observed<br style=\\\"box-sizing: border-box;\\\" />Granular loss observed at ridge shingles</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\"><br style=\\\"box-sizing: border-box;\\\" />Evidence of wind lift<br style=\\\"box-sizing: border-box;\\\" />Lifted shingles observed</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\"><br style=\\\"box-sizing: border-box;\\\" />Lifted shingles observed &ndash; under driven nails observed<br style=\\\"box-sizing: border-box;\\\" />Irregular, &ldquo;wavy&rdquo; surface observed</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif; font-size: 14px; font-weight: 400;\\\"><br style=\\\"box-sizing: border-box;\\\" />Possible hail damage observed<br style=\\\"box-sizing: border-box;\\\" />Surface (mechanical) damage observed</p>\",\"hash\":1519318509367,\"$$hashKey\":\"object:102\"},{\"title\":\"Comment\",\"label\":\"Raised flashing observed. Flashing should be nailed down and sealed to prevent water penetration\",\"type\":\"comment\",\"htmlName\":\"cmt483130191\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">Raised flashing observed. Flashing should be nailed down and sealed</span><br style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\" /><span style=\\\"color: #333333; font-family: sans-serif;\\\">to prevent water penetration</span></p>\",\"hash\":1519318548813,\"$$hashKey\":\"object:103\",\"comment1\":true},{\"title\":\"Comment\",\"label\":\"Rusted flashing observed. Flashing should be painted, repaired/replaced as necessary to prevent leaks\",\"type\":\"comment\",\"htmlName\":\"cmt10068785\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">Rusted flashing observed. Flashing should be painted, repaired/replaced as necessary to prevent leaks</span></p>\",\"hash\":1519318564773,\"$$hashKey\":\"object:104\"},{\"title\":\"Comment\",\"label\":\"Missing/loose flashing observed at:\",\"type\":\"comment\",\"htmlName\":\"cmt996972917\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">Evidence of hail damaged observed to the &ldquo;soft&rdquo; metals. Roof vents, turbines, etc.</span></p>\",\"hash\":1519318581908,\"$$hashKey\":\"object:105\"},{\"title\":\"Comment\",\"label\":\"Skylights Other roof penetrations  Missing caulking at:\",\"type\":\"comment\",\"htmlName\":\"cmt775591713\",\"editMode\":false,\"data\":\"<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">Skylights</p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">Other roof penetrations &ndash; Missing caulking at:</p>\",\"hash\":1519318618426,\"$$hashKey\":\"object:106\"},{\"title\":\"Comment\",\"label\":\"There are nail heads or staples exposed (missing sealant) on some of the flashing, roof vents and in the cap shingles. Recommend sealing to prevent water penetration\",\"type\":\"comment\",\"htmlName\":\"cmt1024138224\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">There are nail heads or staples exposed (missing sealant) on some of</span><br style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\" /><span style=\\\"color: #333333; font-family: sans-serif;\\\">the flashing, roof vents and in the cap shingles. Recommend sealing to</span><br style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\" /><span style=\\\"color: #333333; font-family: sans-serif;\\\">prevent water penetration</span></p>\",\"hash\":1519318678264,\"$$hashKey\":\"object:107\"},{\"title\":\"Comment\",\"label\":\"Underlayment installed under drip flashing, should be on top of flashing. If installed correctly, this will allow water to drip off the roofs edge and not drain under the flashing.\",\"type\":\"comment\",\"htmlName\":\"cmt842516401\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: sans-serif;\\\">Underlayment installed under drip flashing, should be on top of flashing.</span><br style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\" /><span style=\\\"color: #333333; font-family: sans-serif;\\\">If installed correctly, this will allow water to drip off the roofs edge and not</span><br style=\\\"box-sizing: border-box; color: #333333; font-family: sans-serif;\\\" /><span style=\\\"color: #333333; font-family: sans-serif;\\\">drain under the flashing.</span></p>\",\"hash\":1519318739352,\"$$hashKey\":\"object:108\"}]],[[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/11/section-1-c-1.png\",\"isExample\":false,\"withComment\":false,\"data\":\"<h5>Sample Image Comment</h5><p>This is a sample image comment, you can modify or delete it</p>\",\"hash\":1519319353200,\"$$hashKey\":\"object:124\"}],[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/11/section-1-c-2.png\",\"isExample\":false,\"withComment\":false,\"data\":\"<h5>Sample Image Comment</h5><p>This is a sample image comment, you can modify or delete it</p>\",\"hash\":1519319350815,\"$$hashKey\":\"object:126\"}]]],\"prepared_date\":\"Fri Mar 30 2018 23:49:08 GMT+0600 (Bangladesh Standard Time)\"}');
