(2,	1,	'2017-07-22 16:17:11',	'2017-07-22 16:17:11',	'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\r\n\r\n...or something like this:\r\n\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\n\r\nAs a new WordPress user, you should go to <a href=\"http://localhost/mehedi/real-estate/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!\r\n\r\n[vfb id=\'3\']',	'Sample Page',	'',	'publish',	'closed',	'open',	'',	'sample-page',	'',	'',	'2017-08-06 14:52:49',	'2017-08-06 14:52:49',	'',	0,	'http://localhost/mehedi/real-estate/?page_id=2',	0,	'page',	'',	0),
