 organisms;<br /> (iii)the presence, absence, or risk of asbestos, lead-based paint, </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">MOLD</span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">, mildew, corrosive or contaminated drywall &ldquo;Chinese Drywall&rdquo; or any other environmental hazard, environmental pathogen, carcinogen, toxin, mycotoxin, pollutant, fungal presence or activity, or poison;<br /> (iv) types of wood or preservative treatment and fastener compatibility; or </span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(v) the cause of source of a conditions; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(D) anticipate future events or conditions, including but not limited to: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) decay, deterioration, or damage that may occur after the inspection; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(ii) deficiencies from abuse, misuse or lack of use;<br /> (iii) changes in performance of any component or system due to changes in use or occupancy; (iv) the consequences of the inspection or its effects on current or future buyers and sellers; (v) common household accidents, personal injury, or death;<br /> (vi) the presence of water penetrations; or<br /> (vii) future performance of any item;&nbsp;</span></p>\\n</div>\\n</div>\\n</div>\",\"hash\":1512143462474}]],[[{\"title\":\"Section\",\"label\":\"I. STRUCTURAL SYSTEMS\",\"type\":\"section\",\"description\":\"\",\"single\":true,\"hash\":1512143534487}]],[[{\"title\":\"Sub Section\",\"label\":\"A. Foundations\",\"type\":\"subsection\",\"status1\":false,\"status2\":false,\"status3\":false,\"status4\":false,\"data\":\"\",\"single\":true,\"hash\":1512143554142}]],[[{\"title\":\"Comment\",\"label\":\"Comments\",\"type\":\"comment\",\"htmlName\":\"cmt796685976\",\"noProperty\":true,\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 7\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Type of Foundation(s)<br /> </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Post-Tension </span><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Slab on Grade </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Pier and Beam </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Bois d&rsquo;arc </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">At the time of the inspection the foundation appeared to be performing its function </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">I recommend further evaluation of the foundation by a licensed professional engineer </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Digital level analysis of foundation performed with Zip level Pro 2000 </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Measurements were observed to be within normal range </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Recommend further evaluation of foundation, measurements were out of range. </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">There are indications of prior repairs such as concrete pier/piling patches. I recommend that you obtain paperwork on these repairs, including any warranty, from the Seller. </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Not able to view all of foundation due to landscaping<br /> </span></p>\\n<p>&nbsp;</p>\\n</div>\\n</div>\\n</div>\",\"hash\":1512143568573},{\"title\":\"Image\",\"type\":\"image\",\"url\":\"data:image/png;base64,\",\"isExample\":false,\"hash\":1512143610004},{\"title\":\"Comment\",\"label\":\"Comments hello\",\"type\":\"comment\",\"htmlName\":\"cmt802655356\",\"editMode\":false,\"data\":\"<h5>Comment Field</h5><p>This is a comment field, It will appear as this rich text editor, you can edit it to add example</p>\",\"hash\":1512149902863},{\"title\":\"Comment\",\"label\":\"Comments\",\"type\":\"comment\",\"htmlName\":\"cmt1268542336\",\"editMode\":false,\"data\":\"<h5>Comment Field</h5><p>This is a comment field, It will appear as this rich text editor, you can edit it to add example</p>\",\"hash\":1512158839062}]],[[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"#\",\"isExample\":false,\"hash\":1512143621507}]]]}',	'',	'',	'',	'',	''),
(5,	15,	0,	'',	'{\"name\":\"Untitled Form 1\",\"logo\":null,\"tree\":[[[{\"title\":\"Paragraph\",\"label\":\"Comments\",\"type\":\"wysiwyg\",\"htmlName\":\"cmt156572961\",\"noProperty\":true,\"editMode\":false,\"isInstruction\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 5\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: ArialMT; color: #365f91; text-decoration: underline;\\\">THIS REPORT IS NOT TRANSFERABLE FROM THE CLIENT NAMES ABOVE </span></span></p>\\n<p style=\\\"text-align: center;\\\">&nbsp;</p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: Arial; font-weight: bold;\\\">SCOPE OF INSPECTION </span></span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">These standards of practice define the minimum levels of inspection required for substantially completed residential improvements to real property up to four dwelling units. A real estate inspection is a non-technically exhaustive, limited visual survey and basic performance evaluation of the systems and components of a building using normal controls and does not require the use of specialized equipment or procedures. The purpose of the inspection is to provide the client with information regarding the general condition of the residence at the time of inspection. The inspector may provide a higher level of inspection performance than required by these standards of practice and may inspect components and systems in addition to those described by the standards of practice </span></p>\\n<p>&nbsp;</p>\\n<p style=\\\"text-align: center;\\\"><span style=\\\"text-decoration: underline; font-size: 12pt;\\\"><span style=\\\"font-family: Arial; font-weight: bold;\\\">GENERAL LIMITATIONS </span></span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">The inspector is not required to: (A) inspect: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) items other than those listed within these standards of practice; (ii) elevators; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(iii) detached buildings, decks, docks, fences, or waterfront structures or equipment; (iv) anything buried, hidden, latent, or concealed;<br /> (v) sub-surface drainage systems; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(vi) automated or programmable control systems, automatic shut-off, photoelectric sensors, timers, cocks, metering devices, signal lights, lightning arrestor system, remote controls, security or data distribution systems, solar panels, refrigerators (built-in or free standing), wine coolers, ice makers or smart home automation components; or<br /> (vii) concrete flatwork such as; driveways, sidewalks, walkways, paving stones or patios </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(B) report: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) past repairs that appear to be effective and workmanlike except as specifically required by these standards; (ii) cosmetic or aesthetic conditions; or<br /> (iii) wear and tear from ordinary use; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(C) determine: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) insurability, warrantability, suitability, adequacy, compatibility, capacity, reliability, marketability, operating costs, recalls, counterfeit products, product lawsuits, life expectancy, age, energy efficiency, vapor barriers, thermostatic performance, compliance with any code, listing, testing or protocol authority, utility sources, or manufacturer or regulatory requirements except as specifically required by these standards; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(ii) the presence or absence of pests, termites, or other wood-destroying insects or organisms;<br /> (iii)the presence, absence, or risk of asbestos, lead-based paint, </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">MOLD</span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">, mildew, corrosive or contaminated drywall &ldquo;Chinese Drywall&rdquo; or any other environmental hazard, environmental pathogen, carcinogen, toxin, mycotoxin, pollutant, fungal presence or activity, or poison;<br /> (iv) types of wood or preservative treatment and fastener compatibility; or </span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(v) the cause of source of a conditions; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(D) anticipate future events or conditions, including but not limited to: </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(i) decay, deterioration, or damage that may occur after the inspection; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">(ii) deficiencies from abuse, misuse or lack of use;<br /> (iii) changes in performance of any component or system due to changes in use or occupancy; (iv) the consequences of the inspection or its effects on current or future buyers and sellers; (v) common household accidents, personal injury, or death;<br /> (vi) the presence of water penetrations; or<br /> (vii) future performance of any item;</span></p>\\n<div class=\\\"page\\\" title=\\\"Page 6\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(E) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">operate shut-off, safety, stop, pressure or pressure-regulating valves or items requiring the use of codes, keys, combinations, or similar devices;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(F) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">designate conditions as safe;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(G) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">recommend or provide engineering, architectural, appraisal, mitigation, physical surveying, realty, or other specialist services; </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(H) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">review historical records, installation instructions, repair plans, cost estimates, disclosure documents, or other reports; </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(I) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">verify sizing, efficiency, or adequacy of the ground surface drainage system;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(J) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">verify sizing, efficiency, or adequacy of the gutter and downspout system;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(K) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">operate recirculation or sump pumps </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(L) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">remedy conditions preventing inspection of any item;<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(M) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">apply open flame or light a pilot to operate any appliance<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(N) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">turn on decommissioned equipment, systems, or utility services; or<br /> </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">(O) </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">provide repair cost estimates, recommendations, or re-inspection services </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold;\\\">THE CLIENT, BY ACCEPTING THIS PROPERTY INSPECTON REPORT OR RELYING UPON IT IN ANAY WAY, EXPRESSLY AGREES TO THE SCOPE OF INSPECTION AND GENERAL LIMITAITONS INCLUDED IN THIS INSPECTION REPORT </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">This inspection report is made for the sole purpose of assisting the purchaser to determine his and/or her own opinion of feasibility of purchasing the inspected property and does not warrant or guarantee all defects to be found. If you have any questions or are unclear regrading or findings, please call our office prior to the expiration of any time limitations such as option periods. </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">This report contains technical information. If you were not present during this inspection, please call the office to arrange for a consultation with your inspector. If you choose not to consult with the inspector, this inspection company cannot be held liable for your understanding or misunderstanding of the reports content. </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">The contents of this report are for the sole use of the client named above and no other person or party may rely on this report for any reason or purpose whatsoever without the prior written consent of the inspector who authored the report. Any person or party who chooses to rely on this report for any reason or purpose whatsoever without the express written consent of the inspector does so at their own risk and by doing so without the prior written consent of the inspector waives any claim of error or deficiency in this report. </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\'; color: rgb(21.176470%, 37.254900%, 56.862750%);\\\">This report is not intended to be used for determining insurability or warrantability of the structure and may not conform to the Texas Department of Insurance guidelines for property insurability. </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold; font-style: italic; color: rgb(21.176470%, 37.254900%, 56.862750%);\\\">This report is not to be used by or for any property and/or home warranty company. </span></p>\\n</div>\\n</div>\\n</div>\\n<p><span style=\\\"font-family: ArialMT; font-size: 10pt;\\\">The digital pictures within this report are a representative sample of inaccessible areas, deficiencies, or damages in place and should not be considered to show all of the inaccessible areas, deficiencies or damages observed. There will be inaccessible areas, deficiencies, or damages not represented with digital imaging.</span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">&nbsp;</span></p>\\n</div>\\n</div>\\n</div>\",\"hash\":1511243601762}]],[[{\"title\":\"Section\",\"label\":\"I. STRUCTURAL SYSTEMS\",\"type\":\"section\",\"description\":\"\",\"single\":true,\"hash\":1511243802059}]],[[{\"title\":\"Sub Section\