: \'ArialMT\';\\\">Measurements were observed to be within normal range </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Recommend further evaluation of foundation, measurements were out of range. </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513461743319},{\"title\":\"Comment\",\"label\":\"There are indications of prior repairs such as concrete pier/piling patches. I recommend that you obtain paperwork on these repairs, including any warranty, from the Seller.\",\"type\":\"comment\",\"htmlName\":\"cmt111478880\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 7\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">There are indications of prior repairs such as concrete pier/piling patches. I recommend that you obtain paperwork on these repairs, including any warranty, from the Seller. </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513461917128},{\"title\":\"Comment\",\"label\":\"Not able to view all of foundation due to landscaping\",\"type\":\"comment\",\"htmlName\":\"cmt706429286\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 7\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Not able to view all of foundation due to landscaping<br /> </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513461942136},{\"title\":\"Comment\",\"label\":\"Post-tensioned cable ends are not protected. They may be repaired with a concrete patching material\",\"type\":\"comment\",\"htmlName\":\"cmt43531146\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 7\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Post-tensi