font-size: 12.000000pt; font-family: \'ArialMT\';\\\">had limited visibility </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">had full visibility </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Not accessible </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513462136808},{\"title\":\"Comment\",\"label\":\"Crawl space does not appear to be adequately ventilated\",\"type\":\"comment\",\"htmlName\":\"cmt181560616\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 8\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Covers should be removed for proper ventilation </span></p>\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">1 sq.ft. of ventilation is required for every 150 sq.ft. of crawl space<br /> </span> <span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Vent openings should be located within 3&rsquo; of each corner </span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Damaged/blocked ventilation screens observed </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513462161758},{\"title\":\"Comment\",\"label\":\"Crawl space contains too much moisture\",\"type\":\"comment\",\"htmlName\":\"cmt354877322\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 8\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Crawl space contains too much moisture </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513462187509},{\"title\":\"Comment\",\"label\":\"\\u0000 Crawl space does not have adequate drainage\",\"type\":\"comment\",\"htmlName\":\"cmt1020864723\",\"editMode\":false,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 8\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Crawl space does not have adequate drainage </span></p>\\n</div>\\n</div>\\n</div>\\n<p>&nbsp;</p>\",\"hash\":1513462204077}]],[[{\"title\":\"Paragraph\",\"label\":\"Comments\",\"type\":\"wysiwyg\",\"htmlName\":\"cmt687644659\",\"noProperty\":true,\"editMode\":false,\"isInstruction\":true,\"data\":\"<p>&nbsp;</p>\\n<div class=\\\"page\\\" title=\\\"Page 9\\\">\\n<div class=\\\"section\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold; font-style: italic;\\\">Notice: </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">This inspection is one of first impression and the inspector was not provided with any historical information pertaining to the structural integrity of the inspected real property. This is a limited cursory and visual survey of the accessible general conditions and circumstances present at the time of this inspection. Opinions are based on general observations made without the use of specialized tools or procedures. (</span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-style: italic;\\\">Unless otherwise noted</span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">) Therefore, the opinions expressed are one of apparent conditions and not of absolute fact and are only good for the date and time of this inspection. </span></p>\\n<p><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">The inspection of the foundation may show it to be providing adequate support for the structure or having movement typical to this region at the time of the inspection. This does not guarantee the future life or failure of the foundation. </span><span style=\\\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: bold; font-style: italic;\\\">The Inspector is not a structural engineer. This inspection is not an engineering report or evaluation and should not be considered one, either expressed or implied. </span><span style=\\\"font-size: 10.000000pt; font-family: \'ArialMT\';\\\">If any cause of concern is noted on this report, or if you want further evaluation, you should consider an evaluation by an engineer of your choice.&nbsp;</span></p>\\n</div>\\n</div>\\n</div>\\n</div>\",\"hash\":1511243893887}]],[[{\"title\":\"Sub Section\",\"label\":\"B. Grading and Drainage\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511243932742}]],[[{\"title\":\"Comment\",\"label\":\"Improper or inadequate grading around the foundation\",\"type\":\"comment\",\"htmlName\":\"cmt1023772690\",\"editMode\":false,\"data\":\"<p><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Soil level should be at least 4&rdquo; below brick/stone siding<br /></span><span style=\\\"font-size: 12.000000pt; font-family: \'ArialMT\';\\\">Soil level should be at least 6&rdquo; below wood/other cladding</span></p>\",\"hash\":1513850238338},{\"title\":\"Comment\",\"label\":\"Grading should be improved to promote water drainage away from the foundation.\",\"type\":\"comment\",\"htmlName\":\"cmt848041223\",\"editMode\":false,\"data\":\"<p><span style=\\\"font-family: ArialMT; font-size: 16px;\\\">Grading should be improved to promote water drainage away from the foundation.</span></p>\",\"hash\":1513850304590},{\"title\":\"Comment\",\"label\":\"Gravel around the foundation can hold water longer than areas without gravel. Monitor gravel areas for proper drainage\",\"type\":\"comment\",\"htmlName\":\"cmt1436605252\",\"editMode\":false,\"data\":\"<p><span style=\\\"font-family: ArialMT; font-size: 16px;\\\">Gravel around the foundation can hold water longer than areas without gravel. Monitor gravel areas for proper drainage</span></p>\",\"hash\":1513850369876},{\"title\":\"Comment\",\"label\":\"Negative slope of grading toward the home. Monitor this area for proper drainage\",\"type\":\"comment\",\"htmlName\":\"Negative slope of grading toward the home. Monitor this area for proper drainage\",\"editMode\":false,\"data\":\"<p>Negative slope of grading toward the home. Monitor this area for proper<br />drainage</p>\",\"hash\":1513851777671},{\"title\":\"Comment\",\"label\":\"Water can be trapped between landscaping and foundation, monitor area for proper drainage\",\"type\":\"comment\",\"htmlName\":\"cmt192701435\",\"editMode\":false,\"data\":\"<p>Drive slops towards garage<br />Cracks observed at driveway<br />Cracks and settlement observed to driveway<br />Erosion observed<br />Recommend adding ground cover to prevent erosion<br />Water ponding observed &ndash; Grading should be improved</p>\",\"hash\":1513851795747},{\"title\":\"Comment\",\"label\":\"Deficiencies in installed gutter and downspout systems\",\"type\":\"comment\",\"htmlName\":\"cmt1404054308\",\"editMode\":false,\"data\":\"<p>Gutter full of leaves and debris, recommend cleaning<br />Damaged gutters observed<br />Loose gutter nails observed<br />Missing down spouts observed<br />Splash blocks missing and/or turned backwards - Ideally downspouts<br />should drain at least 3&rsquo; away from foundation (recommend adding an<br />extension)</p>\",\"hash\":1513851893859}]],[[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/11/example-1.png\",\"isExample\":false,\"hash\":1511244183644}],[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/11/example-2.png\",\"isExample\":false,\"hash\":1511244179892}]],[[{\"title\":\"Sub Section\",\"label\":\"C. Roof Covering Materials\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511244293936}]],[[{\"title\":\"Comment\",\"label\":