omment\",\"label\":\"Rusted flashing observed. Flashing should be painted, repaired/replaced as necessary to prevent leaks\",\"type\":\"comment\",\"htmlName\":\"cmt422844123\",\"editMode\":false,\"data\":\"<p>Rusted flashing observed. Flashing should be painted, repaired/replaced as necessary to prevent leaks</p>\",\"hash\":1513852642223},{\"title\":\"Comment\",\"label\":\"Missing/loose flashing observed at:\",\"type\":\"comment\",\"htmlName\":\"cmt284817695\",\"editMode\":false,\"data\":\"<p>Evidence of hail damaged observed to the &ldquo;soft&rdquo; metals. Roof vents, turbines, etc.</p>\",\"hash\":1513852676967},{\"title\":\"Comment\",\"label\":\"Skylights Other roof penetrations  Missing caulking at:\",\"type\":\"comment\",\"htmlName\":\"cmt1457574842\",\"editMode\":false,\"data\":\"<p>Skylights</p>\\n<p>Other roof penetrations &ndash; Missing caulking at:</p>\",\"hash\":1513852703831},{\"title\":\"Comment\",\"label\":\"There are nail heads or staples exposed (missing sealant) on some of the flashing, roof vents and in the cap shingles. Recommend sealing to prevent water penetration\",\"type\":\"comment\",\"htmlName\":\"cmt443311545\",\"editMode\":false,\"data\":\"<p>There are nail heads or staples exposed (missing sealant) on some of<br />the flashing, roof vents and in the cap shingles. Recommend sealing to<br />prevent water penetration</p>\",\"hash\":1513852735446},{\"title\":\"Comment\",\"label\":\"Underlayment installed under drip flashing, should be on top of flashing. If installed correctly, this will allow water to drip off the roofs edge and not drain under the flashing.\",\"type\":\"comment\",\"htmlName\":\"cmt268438401\",\"editMode\":false,\"data\":\"<p>Underlayment installed under drip flashing, should be on top of flashing.<br />If installed correctly, this will allow water to drip off the roofs edge and not<br />drain under the flashing.</p>\",\"hash\":1513852756285}]],[[{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/tapta