\":\"Comment\",\"label\":\"Not able to determine the function of all switches.  Switches marked with ? to identify\",\"type\":\"comment\",\"htmlName\":\"cmt919579527\",\"editMode\":false,\"data\":\"<p>Not able to determine the function of all switches. &ndash; Switches<br />marked with &ldquo;?&rdquo; to identify</p>\",\"hash\":1513858079220},{\"title\":\"Comment\",\"label\":\"Bonding or grounding - Appliances such as water heaters, furnaces, chimneys and electrical gutters do not have proper bonding - See page 2\",\"type\":\"comment\",\"htmlName\":\"cmt1103609389\",\"editMode\":false,\"data\":\"<p>Bonding or grounding - Appliances such as water heaters,<br />furnaces, chimneys and electrical gutters do not have proper<br />bonding - See page 2</p>\",\"hash\":1513858097624},{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/12/Screenshot_1-1.png\",\"isExample\":false,\"withComment\":false,\"data\":\"<h5>Sample Image Comment</h5><p>This is a sample image comment, you can modify or delete it</p>\",\"hash\":1513858128295},{\"title\":\"Comment\",\"label\":\"Exposed wiring, wiring termination and junction boxes\",\"type\":\"comment\",\"htmlName\":\"cmt163686990\",\"editMode\":false,\"data\":\"<p>Exposed wiring, wiring termination and junction boxes</p>\",\"hash\":1513858150200},{\"title\":\"Comment\",\"label\":\"Doorbell and chime components\",\"type\":\"comment\",\"htmlName\":\"cmt656324628\",\"editMode\":false,\"data\":\"<p>Broken/damaged button</p>\\n<p><br />Does not operate</p>\\n<p><br />Not securely mounted</p>\",\"hash\":1513858174461},{\"title\":\"Comment\",\"label\":\"Smoke and carbon monoxide alarms\",\"type\":\"comment\",\"htmlName\":\"cmt883141808\",\"editMode\":false,\"data\":\"<p>Not secure to ceiling or wall</p>\",\"hash\":1513858214894},{\"title\":\"Comment\",\"label\":\"Lack of service receptacle at A/C condensing unit\",\"type\":\"comment\",\"htmlName\":\"cmt631840503\",\"editMode\":false,