},{\"title\":\"Comment\",\"label\":\"Exposed receptacles are not equipped with water tight when in use type enclosures  Based on the age of the home, I do not expect to see this type of enclosure. Todays standards would require this type of enclosure to be present on all exposed receptacles.\",\"type\":\"comment\",\"htmlName\":\"cmt989606498\",\"editMode\":false,\"data\":\"<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_2-1.png\\\" alt=\\\"\\\" width=\\\"930\\\" height=\\\"339\\\" /></p>\",\"hash\":1513858329621},{\"title\":\"Comment\",\"label\":\"Deficiencies in lighting devices\",\"type\":\"comment\",\"htmlName\":\"cmt919325493\",\"editMode\":false,\"data\":\"<p>Several bulbs on fixtures did not engage, replace bulbs and retry</p>\\n<p><br />Missing protective globe around bulbs at fixtures</p>\\n<p><br />Several bulbs missing at fixtures</p>\\n<p><br />Fixture not secure to ceiling/wall</p>\\n<p><br />Recessed lighting is rated to not contact insulation. These<br />fixtures require a minimum 3&rdquo; clearance from combustible materials</p>\\n<p><br />Not able to verify if recessed lighting is rated for IC &ndash; insulation</p>\\n<p><br />contact. No labeling observed at fixtures. NIC rated fixtures require<br />a minimum 3&rdquo; clearance from combustible materials</p>\",\"hash\":1513858426474},{\"title\":\"Image\",\"type\":\"image\",\"url\":\"http://clearagain.net/taptapsoftware.com/wp-content/uploads/2017/12/Screenshot_3-1.png\",\"isExample\":false,\"withComment\":false,\"data\":\"<h5>Sample Image Comment</h5><p>This is a sample image comment, you can modify or delete it</p>\",\"hash\":1513858496198},{\"title\":\"Comment\",\"label\":\"Deficiencies in ceiling fans\",\"type\":\"comment\",\"htmlName\":\"cmt1049796052\",\"editMode\":false,\"data\":\"<p>Fan(s) out of balance</p>\\n<p><br />Fan(s) did not operate</p>\\n<p><br />Light on fan did not engage</p>\",\"hash\":1513858514247},{\"title\":\"Comment\",\"label\":\"Missing electrical fixtures\",\"type\":\"comment\",\"htmlName\":\"cmt1100873771\",\"editMode\":false,\"data\":\"<p>Missing electrical fixtures<br />Sub-panels are not properly bonded and grounded<br />Lack of disconnects in appropriate locations</p>\",\"hash\":1513858541895}]],[[{\"title\":\"Section\",\"label\":\"III. HEATING, VENTILATION AND AIR CONDITIONING SYSTEMS\",\"type\":\"section\",\"description\":\"\",\"single\":true,\"hash\":1511244851426}]],[[{\"title\":\"Sub Section\",\"label\":\"A. Heating Equipment\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511244877737}]],[[{\"title\":\"Comment\",\"label\":\"Heating Equipment\",\"type\":\"comment\",\"htmlName\":\"cmt1206964997\",\"editMode\":false,\"data\":\"<p>Type of System Forced Air Heat pump<br />Number of units: 1 2 3 4<br />Energy Source: Electric Natural gas Propane<br />In gas units branch line is: Iron/Flex Copper</p>\",\"hash\":1513858698772},{\"title\":\"Comment\",\"label\":\"The flexible appliance connector is required to be yellow or silver color by todays standard. Older style appliance connectors can contain a copper liner which can corrode and leak with natural gas\",\"type\":\"comment\",\"htmlName\":\"cmt1440081998\",\"editMode\":false,\"data\":\"<p>The flexible appliance connector is required to be yellow or silver color by today&rsquo;s standard. Older style appliance connectors can contain a copper liner which can corrode and leak with natural gas</p>\",\"hash\":1513858761013},{\"title\":\"Comment\",\"label\":\"Shut-valve should be hand operated, not requiring tools No gas active at time of inspection\",\"type\":\"comment\",\"htmlName\":\"cmt188366457\",\"editMode\":false,\"data\":\"<p>Shut-valve should be hand operated, not requiring tools No gas active at time of inspection</p>\",\"hash\":1513858793238},{\"title\":\"Comment\",\"label\":\"I recommend the unit be serviced and evaluated by licensed HVAC technician\",\"type\":\"comment\",\"htmlName\":\"cmt260632394\",\"editMode\":false,\"data\":