hash\":1513859047581},{\"title\":\"Comment\",\"label\":\"The lack of a gas shut-off valve, within 6 feet\",\"type\":\"comment\",\"htmlName\":\"cmt1335725779\",\"editMode\":false,\"data\":\"<p>Gas connectors that are concealed within or extended through walls, floors, partitions, ceilings or appliance housings</p>\",\"hash\":1513859074828},{\"title\":\"Comment\",\"label\":\"Improper conditioned, combustion, and dilution air and locations. A minimum 100 in of combustion air is required at the upper and lower 12 inches of the closet/cabinet\",\"type\":\"comment\",\"htmlName\":\"cmt101351095\",\"editMode\":false,\"data\":\"<p>Improper conditioned, combustion, and dilution air and locations. A minimum 100 in&sup2; of combustion air is required at the upper and lower 12 inches of the closet/cabinet</p>\",\"hash\":1513859102089},{\"title\":\"Comment\",\"label\":\"Improper gas connector materials and connections\",\"type\":\"comment\",\"htmlName\":\"cmt1429175028\",\"editMode\":false,\"data\":\"<p>Gas line should be a rigid pipe where entering heating cabinet, not flexible gas line</p>\",\"hash\":1513859117082},{\"title\":\"Comment\",\"label\":\"Comments\",\"type\":\"comment\",\"htmlName\":\"cmt831254944\",\"editMode\":false,\"data\":\"<h5>Comment Field</h5>\\n<p>This is a comment field, It will appear as this rich text editor, you can edit it to add example</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_5.png\\\" alt=\\\"\\\" width=\\\"581\\\" height=\\\"402\\\" /></p>\",\"hash\":1513859154526},{\"title\":\"Comment\",\"label\":\"The vent pipe, draft hood, draft, proximity to combustibles, and vent termination point and clearances\",\"type\":\"comment\",\"htmlName\":\"cmt470395536\",\"editMode\":false,\"data\":\"<p>Need 1&ldquo;clearance from vent pipe to combustible materials</p>\",\"hash\":1513859211003},{\"title\":\"Comment\",\"label\":\"Vent pipe is too short above the roof. Vent pipe should be extended to not be within 3 of the roofline\",\"type\":\"comment\",\"htmlName\":\"cmt1413003461\",\"editMode\":false,\"data\":\"<p>Vent pipe is too short above the roof. Vent pipe should be extended to not be within 3&rsquo; of the roofline example</p>\",\"hash\":1513859226225},{\"title\":\"Comment\",\"label\":\"Screws observed at vent pipe. Screws should be sealed with a non-combustible tape.\",\"type\":\"comment\",\"htmlName\":\"cmt767449212\",\"editMode\":false,\"data\":\"<p>Screws observed at vent pipe. Screws should be sealed with a non-combustible tape.</p>\",\"hash\":1513859257865},{\"title\":\"Comment\",\"label\":\"Missing fire blocking at ceiling\",\"type\":\"comment\",\"htmlName\":\"cmt1438094823\",\"editMode\":false,\"data\":\"<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_6.png\\\" alt=\\\"\\\" width=\\\"560\\\" height=\\\"360\\\" /></p>\",\"hash\":1513859276750},{\"title\":\"Comment\",\"label\":\"Fire blocking not secure at ceiling\",\"type\":\"comment\",\"htmlName\":\"cmt731702289\",\"editMode\":false,\"data\":\"<p>Fire blocking not secure at ceiling</p>\",\"hash\":1513859320418},{\"title\":\"Comment\",\"label\":\"In electric units:\",\"type\":\"comment\",\"htmlName\":\"cmt1361126499\",\"editMode\":false,\"data\":\"<p>Unit is not heating</p>\\n<p><br />Poor condition of conductors</p>\\n<p><br />Missing protective grommet at wire entrance</p>\",\"hash\":1513859334749}]],[[{\"title\":\"Sub Section\",\"label\":\"B. Cooling Equipment (other than evaporative coolers)\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511244926407}]],[[{\"title\":\"Comment\",\"label\":\"Note: The new Freon standards were implemented as part of the Clean Air Act, which is enforced by the U.S. Environmental Protection Agency. By the year 2020, R22 Freon will no longer be manufactured\",\"type\":\"comment\",\"htmlName\":\"cmt795244072\",\"editMode\":false,\"data\":\"<p>Note: The new Freon standards were implemented as part of the Clean Air Act, which is enforced by the U.S. Environmental Protection Agency. By the year 2020, R22 Freon will no longer be manufactured</p>\",\"hash\":1513859415573},{\"title\":\"Comment\",\"label\":\"Type of System: Central air conditioner\",\"type\":\"comment\",\"htmlName\":\"cmt984996658\",\"editMode\":false,\"data\":\"<p>Type of System: Central air conditioner<br />Number of units: 1 2 3 4</p>\",\"hash\":1513859442895},{\"title\":\"Comment\",\"label\":\"Cooling equipment not tested for cooling, outdoor temperature below 60 in last 24 hours. The condenser(s) were operated briefly to ensure the unit(s) do engage with the thermostat\",\"type\":\"comment\",\"htmlName\":\"cmt1382311198\",\"editMode\":false,\"data\":\"<p>Cooling equipment not tested for cooling, outdoor temperature below 60&deg; in last 24 hours. The condenser(s) were operated briefly to ensure the unit(s) do engage with the thermostat</p>\",\"hash\":1513859474025},{\"title\":\"Comment\",\"label\":\"Inadequate access to equipment for inspection or repair without removing permanent construction of building finish.\",\"type\":\"comment\",\"htmlName\":\"cmt36244109\",\"editMode\":false,\"data\":\"<p>Average Temperature drop (Delta &ndash;T):<br />Normal range is 15&deg;-20&deg;</p>\\n<p><br />Downstairs Delta-T &ndash;<br />Upstairs Delta-T &ndash;</p>\\n<p>Inadequate cooling as demonstrated by performance</p>\\n<p>I recommend the unit be serviced and evaluated by licensed HVAC<br />technician</p>\",\"hash\":1513859491801},{\"title\":\"Comment\",\"label\":\"Inadequate access to equipment for inspection or repair without removing permanent construction of building finish. No floored passageway present\",\"type\":\"comment\",\"htmlName\":\"cmt119002564\",\"editMode\":false,\"data\":\"<p>Inadequate access to equipment for inspection or repair without<br />removing permanent construction of building finish. No floored<br />passageway present</p>\",\"hash\":1513859673879},{\"title\":\"Comment\",\"label\":\"Primary drain line not insulated. Insulating the drain line prevents\",\"type\":\"comment\",\"htmlName\":\"cmt807008418\",\"editMode\":false,\"data\":\"<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_7.png\\\" alt=\\\"\\\" width=\\\"535\\\" height=\\\"334\\\" /></p>\",\"hash\":1513859697752},{\"title\":\"Comment\",\"label\":\"Condensing unit lacking adequate clearances or air circulation or that has deficiencies in the condition of fins, location, levelness, or elevation above ground surfaces\",\"type\":\"comment\",\"htmlName\":\"cmt579210721\",\"editMode\":false,\"data\":\"<p>Condenser pad should be leveled for proper condenser operation</p>\\n<p><br />Trim foliage away from condensing unit(s)</p>\\n<p><br />Condenser pad should be raised 3&rdquo; above the grade</p>\\n<p><br />Damaged fins should be &ldquo;combed&rdquo; straight</p>\\n<p>Condensing unit is dirty, recommend cleaning for maximum air<br />flow</p>\",\"hash\":1513859734198},{\"title\":\"Comment\",\"label\":\"Based on the labeling of the panel, the conductor and/or the overcurrent protective devices are not appropriately sized for the condensing unit.\",\"type\":\"comment\",\"htmlName\":\"cmt1377849462\",\"editMode\":false,\"data\":\"<p>~ I recommend further evaluation by a licensed electrician</p>\\n<p>~ Condenser max breaker is ____ amp, service panel has _____amp</p>\\n<p><br />~ Condenser max breaker is ____ amp, service panel has _____amp</p>\",\"hash\":1513859772054}]],[[{\"title\":\"Sub Section\",\"label\":\"C. Duct System, Chases and Vents\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245054674}]],[[{\"title\":\"Comment\",\"label\":\"Duct should not be attached to the end of plenum. The end of the plenum should be solid to allow air pressure to building and then fill the ducting with air\",\"type\":\"comment\",\"htmlName\":\"cmt1016256126\",\"editMode\":false,\"data\":\"<p>Deficiencies in:</p>\\n<p><br />Dirty filters observed. Recommend replacing<br />Filter appears to be the incorrect size<br />Filter installed backwards</p>\\n<p><br />Grills or registers</p>\\n<p><br />Rusted grills observed<br />Dirty supply air register(s) observed</p>\\n<p><br />Dirty return air grill(s) observed<br />Damaged/dented air grill(s) observed</p>\\n<p>Filter door does not close completely &ndash; this allows unconditioned<br />attic air to enter the unit</p>\",\"hash\":1513859826603},{\"title\":\"Comment\",\"label\":\"Audible vibration heard at supply registers\",\"type\":\"comment\",\"htmlName\":\"cmt806054149\",\"editMode\":false,\"data\":\"<p>Audible vibration heard at supply registers</p>\",\"hash\":1513860152830},{\"title\":\"Comment\",\"label\":\"Improper or inadequate clearance from the earth in crawl space\",\"type\":\"comment\",\"htmlName\":\"cmt1405845656\",\"editMode\":false,\"data\":\"<p>Ducts in contact with dirt Plenum in contact with earth</p>\",\"hash\":1513860171825}]],[[{\"title\":\"Section\",\"label\":\"IV. PLUMBING SYSTEMS\",\"type\":\"section\",\"description\":\"\",\"single\":true,\"hash\":1511245206308}]],[[{\"title\":\"Sub Section\",\"label\":\"A. Plumbing Supply, Distribution Systems and Fixtures\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245370870}]],[[{\"title\":\"Label\",\"type\":\"label\",\"label\":\"Note: All interior plumbing fixtures are operated for 2-5 minutes during inspection\",\"hash\":1511245395685},{\"title\":\"Comment\",\"label\":\"Location of homeowners main water supply shutoff valve:\",\"type\":\"comment\",\"htmlName\":\"cmt1131050827\",\"editMode\":false,\"data\":\"<p>Not located Flower bed Garage Valve handle not visible<br />Front yard Laundry room</p>\",\"hash\":1513860230200},{\"title\":\"Comment\",\"label\":\"Type of Supply Lines:\",\"type\":\"comment\",\"htmlName\":\"cmt480780590\",\"editMode\":false,\"data\":\"<p>Copper Pex Galvanized Iron PVC/CPVC</p>\\n<p><br />Meter box full of water, meter not visible<br />Presence of active leaks as indicated by movement at the water meter</p>\\n<p><br />The lack of a pressure reducing valve when the water pressure<br />exceeds 80 PSI &ndash; Not located</p>\",\"hash\":1513860281869},{\"title\":\"Comment\",\"label\":\"Hose bibs\",\"type\":\"comment\",\"htmlName\":\"cmt810055881\",\"editMode\":false,\"data\":\"<p>Not securely mounted in wall. Recommend securing with mortar</p>\\n<p>Missing anti-siphon device &ndash; This device prevents &ldquo;dirty&rdquo; hose<br />water being drawn back into the fresh water system</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_8.png\\\" width=\\\"312\\\" height=\\\"315\\\" /></p>\\n<p>&nbsp;</p>\\n<p>Hose bib leaks at valve stem when in use. The valve stem can be &ldquo;re-packed&rdquo; to prevent leaking.</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"../wp-content/uploads/2017/12/Screenshot_9.png\\\" width=\\\"306\\\" height=\\\"304\\\" /></p>\\n<p>&nbsp;</p>\\n<p>Missing insulation at hose bib riser. Recommend insulating water<br />line to prevent freezing</p>\",\"hash\":1513860320084},{\"title\":\"Comment\",\"label\":\"The condition of the gas distribution system\",\"type\":\"comment\",\"htmlName\":\"cmt1316693503\",\"editMode\":false,\"data\":\"<p>Gas line should be capped when not in use</p>\\n<p>No gas active at time of inspection</p>\",\"hash\":1513860451112},{\"title\":\"Comment\",\"label\":\"Installation, condition, and operation of commodes\",\"type\":\"comment\",\"htmlName\":\"cmt308334473\",\"editMode\":false,\"data\":\"<p>Loose on the floor<br />Water tank loose on commode</p>\\n<p><br />Flapper valve leaks after flushing<br />Missing 1&rdquo; air gap at the water line used to fill commode</p>\\n<p><br />Leak observed at gasket<br />Missing water fill hose in tank</p>\",\"hash\":1513860474645},{\"title\":\"Comment\",\"label\":\"Fixtures, showers, tubs, and enclosures\",\"type\":\"comment\",\"htmlName\":\"cmt1361916747\",\"editMode\":false,\"data\":\"<p>Low water pressure observed at:<br />Missing weather stripping at bottom of shower door</p>\\n<p><br />Shower door swings closed on its own<br />Shower diverter not fully engaged</p>\\n<p><br />Chip(s) observed at tubs and/or sinks<br />Water stains and/or damage observed under sinks</p>\\n<p><br />Leak at shower head when in use<br />Shower door does not latch when closed</p>\\n<p><br />Cracks in surface of sink-tub basin<br />Water leaks behind faucet when shower diverter is engaged</p>\",\"hash\":1513860513772}]],[[{\"title\":\"Sub Section\",\"label\":\"B. Drains, Wastes, and Vents\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245456244}]],[[{\"title\":\"Comment\",\"label\":\"Leaks observed at:\",\"type\":\"comment\",\"htmlName\":\"cmt1093683490\",\"editMode\":false,\"data\":\"<p>Accordion style drain line observed. This style of drain is not permitted<br />since it is prone to clogging. Smooth wall drain pipe is required</p>\",\"hash\":1513860590049},{\"title\":\"Comment\",\"label\":\"Cast iron drain lines present. Due to the age of the cast iron, I recommend further evaluation by licensed plumber to perform a hydrostatic test to determine if a hidden leaks exists\",\"type\":\"comment\",\"htmlName\":\"cmt950257583\",\"editMode\":false,\"data\":\"<p>Cast iron drain lines present. Due to the age of the cast iron, I<br />recommend further evaluation by licensed plumber to perform a<br />hydrostatic test to determine if a hidden leaks exists</p>\",\"hash\":1513860607109},{\"title\":\"Comment\",\"label\":\"No vent stack visible for:\",\"type\":\"comment\",\"htmlName\":\"cmt1216926064\",\"editMode\":false,\"data\":\"<p>Missing cover at drain line clean out</p>\",\"hash\":1513860624415}]],[[{\"title\":\"Sub Section\",\"label\":\"C. Water Heating Equipment\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245567967}]],[[{\"title\":\"Comment\",\"label\":\"Many manufactures discourage wrapping your water heater with insulation and most state that it will void their warranty. Consult your owners manual for further details\",\"type\":\"comment\",\"htmlName\":\"cmt598966489\",\"editMode\":false,\"data\":\"<p>Shut-valve should be hand operated, not requiring tools<br />No gas active at time of inspection</p>\",\"hash\":1513860657780},{\"title\":\"Comment\",\"label\":\"Type of Observable Vent Pipe:\",\"type\":\"comment\",\"htmlName\":\"cmt426732381\",\"editMode\":false,\"data\":\"<p>Double Wall Direct vent Cement/Asbestos PVC</p>\",\"hash\":1513860733403},{\"title\":\"Comment\",\"label\":\"A temperature and pressure relief valve that:\",\"type\":\"comment\",\"htmlName\":\"cmt462675168\",\"editMode\":false,\"data\":\"<p>Valve not forced open at time of inspection. Forcing valve open can<br />cause valve to leak after testing because of sediment and corrosion<br />build up in tank.</p>\",\"hash\":1513860773298},{\"title\":\"Comment\",\"label\":\"Lacks proper termination:\",\"type\":\"comment\",\"htmlName\":\"cmt151557295\",\"editMode\":false,\"data\":\"<p>No drain line connected<br />Should terminate within 6&rdquo; of the ground</p>\\n<p><br />Missing 90&deg; elbow toward the ground</p>\",\"hash\":1513860783705},{\"title\":\"Comment\",\"label\":\"Improper relief line - corrugated copper pipe observed. A smooth copper pipe or CPVC drain line required to not restrict water flow\",\"type\":\"comment\",\"htmlName\":\"cmt892253937\",\"editMode\":false,\"data\":\"<p>Improper relief line - corrugated copper pipe observed. A smooth<br />copper pipe or CPVC drain line required to not restrict water flow</p>\",\"hash\":1513860833102},{\"title\":\"Comment\",\"label\":\"In gas units, report as deficient:\",\"type\":\"comment\",\"htmlName\":\"cmt740129418\",\"editMode\":false,\"data\":\"<p>Gas leaks detected. Recommend further evaluation by licensed<br />plumber</p>\",\"hash\":1513860844497},{\"title\":\"Comment\",\"label\":\"In electric units, report as deficient:\",\"type\":\"comment\",\"htmlName\":\"cmt342927225\",\"editMode\":false,\"data\":\"<p>Operation of heating elements</p>\\n<p><br />Condition of conductors</p>\\n<p><br />Missing protective grommet at wire entrance</p>\",\"hash\":1513860877461}]],[[{\"title\":\"Sub Section\",\"label\":\"D. Hydro-Massage Therapy Equipment\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245634036}]],[[{\"title\":\"Comment\",\"label\":\"GFCI: Present Not Present/located\",\"type\":\"comment\",\"htmlName\":\"cmt582333579\",\"editMode\":false,\"data\":\"<p>~ Located at: Master closet Electrical panel</p>\",\"hash\":1513861351373},{\"title\":\"Comment\",\"label\":\"Access Cover:\",\"type\":\"comment\",\"htmlName\":\"cmt610531365\",\"editMode\":false,\"data\":\"<p>Available and accessible</p>\\n<p><br />Available and not accessible</p>\\n<p><br />Not Available or accessible</p>\",\"hash\":1513861491029},{\"title\":\"Comment\",\"label\":\"The inspector is not required to determine the adequacy of the selfdraining features of circulations systems\",\"type\":\"comment\",\"htmlName\":\"cmt1276789209\",\"editMode\":false,\"data\":\"<p>The inspector is not required to determine the adequacy of the selfdraining<br />features of circulations systems</p>\",\"hash\":1513861563545}]],[[{\"title\":\"Section\",\"label\":\"V. APPLIANCES\",\"type\":\"section\",\"description\":\"\",\"single\":true,\"hash\":1511245693418}]],[[{\"title\":\"Sub Section\",\"label\":\"A. Dishwasher\",\"type\":\"subsection\",\"status\":\"i\",\"data\":\"\",\"single\":true,\"hash\":1511245707593}]],[[{\"title\":\"Comment\",\"label\":\"I recommend further evaluation by an appliance technician Deficiencies in performance or mounting\",\"type\":\"comment\",\"htmlName\":\"cmt880805120\",\"editMode\":false,\"data\":\"<p>I recommend further evaluation by an appliance technician Deficiencies in performance or mounting</p>\",\"hash\":1513861642124},{\"title\":\"Comment\",\"label\":\"Door gasket\",\"type\":\"comment\",\"htmlName\":\"cmt232393874\",\"editMode\":false,\"data\":\"<p>Control knob