tle\":\"Comment\",\"label\":\"Crawl space does not appear to be adequately ventilated\",\"type\":\"comment\",\"htmlName\":\"cmt941200159\",\"editMode\":false,\"data\":\"<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">Covers should be removed for proper ventilation</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">1 sq.ft. of ventilation is required for every 150 sq.ft. of crawl space<br style=\\\"box-sizing: border-box;\\\" /></span><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">Vent openings should be located within 3&rsquo; of each corner</span></p>\\n</div>\\n</div>\\n<div class=\\\"layoutArea\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\">\\n<div class=\\\"column\\\" style=\\\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\\\">\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px;\\\"><span style=\\\"box-sizing: border-box; font-size: 12pt; font-family: ArialMT;\\\">Damaged/blocked ventilation screens observed</span></p>\\n</div>\\n</div>\",\"hash\":1519317407457},{\"title\":\"Comment\",\"label\":\"Crawl space contains too much moisture\",\"type\":\"comment\",\"htmlName\":\"cmt1311319756\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: ArialMT; font-size: 16px;\\\">Crawl space contains too much moisture</span></p>\",\"hash\":1519317438895},{\"title\":\"Comment\",\"label\":\"Crawl space does not have adequate drainage\",\"type\":\"comment\",\"htmlName\":\"cmt1093483282\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: ArialMT; font-size: 16px;\\\">Crawl space does not have adequate drainage</span></p>\",\"hash\":1519317451703},{\"title\":\"Paragraph\",\"label\":\"Comments\",\"type\":\"wysiwyg\",\"htmlName\":\"cmt274908845\",\"noProperty\":true,\"editMode\":false,\"isInstruction\":true,\"data\":\"<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold; font-style: italic;\\\">Notice:&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">This inspection is one of first impression and the inspector was not provided with any historical information pertaining to the structural integrity of the inspected real property. This is a limited cursory and visual survey of the accessible general conditions and circumstances present at the time of this inspection. Opinions are based on general observations made without the use of specialized tools or procedures. (</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-style: italic;\\\">Unless otherwise noted</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">) Therefore, the opinions expressed are one of apparent conditions and not of absolute fact and are only good for the date and time of this inspection.</span></p>\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; outline: 0px; color: #333333; font-family: sans-serif;\\\"><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">The inspection of the foundation may show it to be providing adequate support for the structure or having movement typical to this region at the time of the inspection. This does not guarantee the future life or failure of the foundation.&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: Arial; font-weight: bold; font-style: italic;\\\">The Inspector is not a structural engineer. This inspection is not an engineering report or evaluation and should not be considered one, either expressed or implied.&nbsp;</span><span style=\\\"box-sizing: border-box; font-size: 10pt; font-family: ArialMT;\\\">If any cause of concern is noted on this report, or if you want further evaluation, you should consider an evaluation by an engineer of your choice.&nbsp;</span></p>\",\"hash\":1519317481613}]],[[{\"title\":\"Sub Section\",\"label\":\"B. Grading and Drainage\",\"type\":\"subsection\",\"data\":\"\",\"single\":true,\"hash\":1519317923884}]],[[{\"title\":\"Comment\",\"label\":\"Improper or inadequate grading around the foundation\",\"type\":\"comment\",\"htmlName\":\"cmt414422118\",\"editMode\":false,\"data\":\"<p><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">Soil level should be at least 4&rdquo; below brick/stone siding<br style=\\\"box-sizing: border-box;\\\" /></span><span style=\\\"box-sizing: border-box; color: #333333; font-size: 12pt; font-family: ArialMT;\\\">Soil level should be at least 6&rdquo; below wood/other cladding</span></p>\",\"hash\":1519317932068},{\"title\":\"Comment\",\"label\":\"Grading should be improved to promote water drainage away from the foundation.\",\"type\":\"comment\",\"htmlName\":\"cmt503331613\",\"editMode\":false,\"data\":\"<p><span style=\\\"color: #333333; font-family: ArialMT; font-size: 16px;\\\">Grading should be improved to promote water drainage away from the foundation.</span></p>\",\"hash\":1519317961396},{\"title\":\"Comment\",\"label\":\"Gravel around the foundation can hold water longer than areas without gravel. Monitor gravel areas for proper drainage\",\"type\":\"comment\",\"htmlName\":\